import React from "react";
import "./login.css";

import { Link } from 'react-router-dom'
import Header from '../../components/header/Header'
import { useForm } from 'react-hook-form'


export const Login = () => {
  const { 
    register,
    handleSubmit,
    setError,
    formState: { errors, isValid},
    } = useForm({
    defaultValues: {
      email: '',
      password: ''
    },
    mode: 'onChange',
  });

  const onSubmit = (values) => {
    console.log(values);

  };

  return (
    <>
    <Header />
    <section className="Login">
      
        <div className="preview">
        
        <h3 className="text-center">Вход</h3>
        <div className="registration-cssave" >
    <form onSubmit={handleSubmit(onSubmit)}>
      
        <div class="form-group">
          <input className="form-control-item" type="email" name="email" id="email" placeholder="Email"  />
            
        </div>
        <div class="form-group">
            <input className="form-control-item" type="password" name="Пароль" minlength="6" id="password" placeholder="Пароль"/>
            
        </div>
        <div class="form-group">
          
            <button className="btn btn-primary btn-block create-account" type="submit">ВОЙТИ</button>
        </div>
        <div class="form-group">
        <Link to='/register'> 
            <button className="register" type="submit">Нет аккаунта? <a>Зарегистрироваться</a></button>
            </Link>
        </div>
    </form>
</div>
        </div>
      
    </section>
    </>
  );
};

export default Login
